import React from 'react'

const Checkout = (props) => {
    var orderInfo=props.location.newDishArray;
    return (
        <div>
            <h3> Order Summary: </h3>
            <h4>------------------------------------------------------</h4>
            {orderInfo.map((val,idx)=>{
                return(
                    <div>
                        
                        <h4>dish: <strong>{val.Dish_Name}</strong></h4>
                        <h4>Quantity: <strong>{val.quantity}</strong></h4>
                        <h4>Price: <strong>{val.Dish_Price}</strong></h4>
                        <h4>------------------------------------------------------</h4>
                        

                    </div>
                )

            })}
                    <div>
                        <label htmlFor="address:"><strong>Add delivery address:-</strong></label><br></br><br></br>
                        <input id="address" name="address" placeholder="Enter delivery address"/>
                        <button>Place Order</button>
            </div>
        </div>
    )
}

export default Checkout
